import React from "react";

export const Header = () => {
  return (
    <div className="w-[100%] h-[100px] border-b-[0.05px] border-[#c79427] flex">
      <div className="w-[300px] h-[100px] border-r-[0.05px] border-[#c79427]">
        <p className="text-[30px] text-center text-[#c79427] font-bold ">Asset</p>
        <p className="text-[30px] text-center text-[#c79427] ">Asset SoftWare</p>

      </div>
    </div>
  );
};
